import React from "react";
import "./card.css";
class CardRow extends React.Component {
  render() {
    return (
      <div className="card">
        <img src={this.props.track.image[2]["#text"]} alt="" />
        <h1>{this.props.track.name}</h1>
        <p>{this.props.track.artist.name}</p>
      </div>
    );
  }
}

export default CardRow;
